import React from 'react';
import './card.css';

function Card(props) {

    <div className="card">
        <img src={cardsList.image} alt="Imagem Ilustrativa" className="card-image" />
        <div className="card-underRectangle">
            <p className="card-subject">{cardsList.course}</p>
            <h1 className="card-task">{cardsList.title}</h1>
            <p className="card-deadline">{cardsList.deadline}</p>
        </div>
    </div>

};

export default Card;
